INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 401, 102301, 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24001, 2, 0.0, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 402, 102301, 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24002, 2, 0.0, "アヤネ", 2.21);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 403, 102301, 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24003, 2, 0.0, "アヤネ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 701, 192201, 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24004, 1, 0.0, "アサヒ", 1.99);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 702, 192201, 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24005, 2, 0.0, "アサヒ", 2.21);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 703, 192201, 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24006, 1, 0.0, "アサヒ", 3.33);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 801, 192301, 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24007, 2, 0.0, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 802, 192301, 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24008, 2, 0.0, "部員３", 2.68);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 803, 192301, 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24009, 2, 0.0, "部員３", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 501, 192501, 10046, "やった！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24010, 1, 0.0, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 502, 192501, 10046, "勝ったよ！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24011, 1, 0.0, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 503, 192501, 10046, "いい調子！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24012, 1, 0.0, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 111, 113501, 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24013, 2, 0.0, "ミサト", 5.33);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 112, 113501, 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24014, 2, 0.0, "ミサト", 6.85);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 113, 113501, 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24015, 2, 0.0, "ミサト", 3.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 611, 192401, 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24016, 2, 0.0, "ダイチ", 6.11);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 612, 192401, 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24017, 2, 0.0, "ダイチ", 6.75);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 613, 192401, 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24018, 2, 0.0, "ダイチ", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 211, 113401, 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24019, 1, 0.0, "ハツネ", 4.52);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 212, 113401, 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24020, 1, 0.0, "ハツネ", 3.89);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 213, 113401, 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24021, 2, 0.0, "ハツネ", 13.49);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 311, 106501, 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24022, 2, 0.0, "カヤ", 3.17);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 312, 106501, 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24023, 2, 0.0, "カヤ", 4.42);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 313, 106501, 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24024, 1, 0.0, "カヤ", 2.89);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 421, 102301, 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24025, 3, 0.0, "アヤネ", 3.71);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 721, 192201, 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24026, 1, 0.0, "アサヒ", 5.1);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 821, 192301, 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24027, 3, 0.0, "部員３", 4.34);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 521, 192501, 10046, "いい勝負だったよ\nまたやろうね", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24028, 1, 0.0, "", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 101, 113501, 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24029, 2, -360.0, "ミサト", 5.62);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 102, 113501, 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24030, 2, -360.0, "ミサト", 9.58);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 103, 113501, 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24031, 2, -360.0, "ミサト", 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 104, 113501, 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24032, 1, -360.0, "ミサト", 9.13);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (24, 105, 113501, 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00", 24033, 2, -360.0, "ミサト", 8.27);
